import React from 'react';
import Fab from '@material-ui/core/Fab';
import AddIcon from '@material-ui/icons/Add';
import { makeStyles } from '@material-ui/core/styles';
import SelectUser from './selectUser';
import { createMuiTheme } from '@material-ui/core/styles';
import purple from '@material-ui/core/colors/purple';
import { ThemeProvider } from '@material-ui/styles';

const useStyles = makeStyles(theme => ({
    addRoom: {
        position: 'absolute',
        bottom: 56,
        right: 10,
        zIndex: 10000,
        boxShadow: ' 1px -1px 2px 1px #209cee',
        background: 'white',
    },
    fab: {
        backgroundColor: '209cee',
        position: 'absolute',
    },
}));

const theme = createMuiTheme({
    palette: {
        primary: {
            light: '#85edff',
            main: '#209cee',
            dark: '#2e77d5',
        },
        secondary: {
            main: '#f44336',
        },
    },
});

export default function AddUser() {
    const classes = useStyles();
    const [addRoom, setAddRoom] = React.useState(false);
    const [clicks, addClicks] = React.useState(0)


    return (
        <ThemeProvider theme={theme}>
            <div className={classes.addRoom} >
                <Fab color="primary" aria-label="add" className={classes.fab} onClick={() => {
                    addClicks(clicks + 1);
                    if (clicks % 2 === 0) {
                        console.log('even');
                    } else {
                        console.log('odd');
                    };
                }}>
                    <AddIcon />
                </Fab>
                <span>Add User</span>
                <SelectUser />
            </div>
        </ ThemeProvider >
    );
}
